int firstMissingPositive(int* A, int n1) {
    int n=n1;
    int i=n-1;
    int j=0;
    int count=0;
    while(j<=n-1&&j<=i)
    {
       if(A[j]<=0&&j<=i||A[j]>n+1&&j<=i)
       {
           if(A[i]>0&&A[i]<=n+1)
           {
           int tem;
           tem=A[j];
           A[j]=A[i];
           A[i]=tem;
           i--;
           j++;
           count++;
           }
           else{
           count=count+1;;
           i--;
           }

       }
       else{
       j++;
       }


    }
   printf("value of count is %d\n",count);
    j=0;
    if(A[0]<=0)
    return 1;
     while(j<(n))
    {
     printf("%d ",A[j]);
        j++;
    }
    j=0;
    while(j<(n-count))
    {
        int p;
        p=abs(abs(A[j])-1);
     //   printf("A[j] is %d and p[aj-1] %d\n",A[j],A[A[j]-1]);
        if(A[p]>0)
        {

            A[p]=A[p]*(-1);
        }
        j++;
    }

    j=0;
    while(j<(n-count))
    {
        if(A[j]>0)
        return j+1;
       j++;
    }
    return j+1;

}
